import 'package:injectable/injectable.dart';import 'package:shiftapp/core/bloc/base_cubit.dart';import '../../../../../../presentationUser/common/common_state.dart';import '../../../../data/repositories/vehicles_repository.dart';import '../../../../domain/entities/index.dart';@Injectable()class VehicleCamerasCubit extends BaseCubit {  final VehiclesRepository _repository;  VehicleCamerasCubit(    this._repository,  );  void fetchVehicleCameras(int vehicleId) async {    executeEmitterData(() => _repository.fetchVehicleCameras(vehicleId));  }  void deleteVehicleCamera(int id) {    executeEmitterListener(() => _repository.deleteVehicleCamera(id));  }}